					} catch (error) {
						console.log("Error decrypting filename:", error);
						return "";
					}
				}

                async function decryptData(encryptedData, password) {
                    try {
                        const encryptedDataBuff = base64_to_buf(encryptedData);
                        const salt = encryptedDataBuff.slice(0, 16);
                        const iv = encryptedDataBuff.slice(16, 28);
                        const data = encryptedDataBuff.slice(28);
                        const passwordKey = await getPasswordKey(password);
                        const aesKey = await deriveKey(passwordKey, salt, ["decrypt"]);
                        return await window.crypto.subtle.decrypt(
                            { name: "AES-GCM", iv: iv },
                            aesKey,
                            data
                        );
                    } catch (e) {
                        console.error("Decryption error:", e);
                        return null;
                    }
                }

				document.getElementById('decryptButton').addEventListener('click', async function() {
					let password = document.getElementById("password").value;
					decryptedFilename = await decryptFilename(encryptedFilename, password);
					console.log("Decrypted Filename:", decryptedFilename);
					await decrypt(); 
				});

				document.getElementById("password").addEventListener("keypress", function(event) {
					if (event.key === "Enter") {
						event.preventDefault();
						document.getElementById("decryptButton").click();

					toast.className = "show";

					setTimeout(() => {
